@volkspartei, @sebastiankurz und @Gernot_Bluemel
 im Klaren darüber sind, was ihre Unterstützung des #anti #korruptionsvolksbegehrens für sie selbst bedeutet… #ibizaUA #oebag #beidlgate https://t.co/bdvLkLRmAs

Der #ibizaUA bekam den Akt mit dem Beschuldigtenstatus von 
@Gernot_Bluemel
 am 3.2.. Am 29.1. war er bei #sobotka. Genug Zeit also, im die Info an Blümel zu geben und #suppan anfragen zu lassen. Deshalb brauchen wir einen neuen Vorsitzenden. Ein Schelm, der Böses dabei denkt! https://t.co/aHMCr5TIfO
